import React from "react";
import "src/page/homepage/homepage.styles.scss";

import MenuItem from "src/components/menu-item/MenuItem";

const HomePage = () => {
  return (
    <div className={"home-page"}>
      <div className={"directory-menu"}>
        <MenuItem title={"Shirts"} />
        <MenuItem title={"Jackets"} />
        <MenuItem title={"Bottoms"} />
        <MenuItem title={"Shoes"} />
        <MenuItem title={"Accessiores"} />
      </div>
    </div>
  );
};

export default HomePage;
